INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (208,'052','불길이 대들보까지 미치고 있으나 집을 짓고 사는 제비와 참새들이 어찌 그 위급함을 알겠습니까?. 한 번은 기쁘고 한 번은 쾌하니 이 또한 신수인 것을 어찌 하겠습니까? 일마다 많이 문란하고 흑되이 세월만 보내기 쉬우니 주의하십시오.','나는 새의 날개가 부러졌으니 진퇴를 당하기 매우 어렵습니다. 물과 불 등으로 한 번 놀랠 것이 있으니 부디 조심하십시오. 정월과 이월에는 밝은 길하고 밝은 흉하지만 주저앉지 말고 하던 일을 경송 지속해 감이 옳을 것입니다.','신략하지 않으면서도 인정에 이끌려 남을 돕게 되면 길함이 도리어 흉해짐 것이니 주의하십시오. 봄 중에 금심이 있으니 부부간이거나 자식의 금심이겠습니다. 신수가 고단하니 실행하거나 새 일을 도모하지 마십시오. 그 일로 인해 고뇌가 생길 것입니다.','날을 도왔 줄 관인은 어디 있는 고 하니 서쪽과 북쪽 지방입니다. 일을 마무리 짓거나 재기에 이익이 있습니다. 3월과 4월에는 미리 부처넉끼 기도함이 좋겠습니다. 사촌간에 금심이 있고 우환이 생기면 감동하기 어렵겠습니다.','달콤한 말에 귀를 기울이면 작놀에 넘어가기 쉽습니다.. 흑 잃음과 흑 실상으로 마음만 상하겠습니다. 미리 꼴을 먹으면 화가 들어와서 오히려 복이 될 수도 있습니다. 마음속에 말못할 무로움이 있으니 항상 마음이 멀리 밖에 있습니다.','재수를 보거든 정성껏 구하십시오. 그러면 다시 얻지 못하더라도 정성의 대가는 받게 됩니다. 동방에 관인이 왼쪽 우연히 도왔줄 것이니 새로운 일을 시작하거나 일의 손재주에 신중하면 이익이 있겠습니다. 비록 큰 재물은 얻지 못해도 작은 이익이 있겠습니다.','양쪽이 화합해서 바라는 바가 드디어 성취될 때입니다. 다른 사람과 힘을 같이 합하면 가히 띠를 이룰 수가 있겠습니다. 신수도 대길하고 재수도 자신에게 있는데 어찌 사람과 만나 일을 도모함을 주저하겠습니까. 내가 행하는 대로 행운이 도울 것입니다.','7월과 8월에는 수복이 하는 일이 잘 복을 불러들입니다. 만약 결과이 아니더라도 자손에게 경사가 생기겠습니다. 꿩이 파는 아침과 달이 뜨는 자줏빛에 몸이 꽃 사이로 취해 걸음과 같으니 얼마나 풍부하겠습니까?','다른 사람과 더불어 일을 놀함에 길함이 있는 듯 하나 도리어 흉함으로 변하니 조심하십시오. 분수를 지키미 상책이니 큰 일을 도모하기 위해 독부서주한들 아무런 이익이 없겠습니다. 이 달의 운수는 모든 일을 조심하고 정직을 기해야 합니다.','이름과 경영하는 일에 머리는 있으되 꼬리가 없는 것과 같으니 유의하십시오. 다른 이권에 갑여하면 반드시 해가 따르겠습니다. 어려움을 건너갈 관인은 어디 있겠습니까. 서쪽과 북쪽입니다. 일을 마무리 짓는 것과 새 일을 도모하는 것에 정직을 하셔야 합니다.','행하려고 분주지만 나아가지 못하니 심중에 무로움만 가득 쌓이게 되겠습니다. 만약 술을 가까이 하게 되면 반드시 그로 인한 해를 입게 되겠습니다. 이익은 서쪽과 북쪽에 있으니 일을 마무리 짓는데 과감해야만 그 다음에 이익이 돌아오겠습니다.','비록 재물은 생기지만 다른 사람이 시기하여 해를 끼칠 수도 있으니 유념하십시오. 동방은 불리하고 서방은 길하니 일을 시작하거나 새롭게 방차를 가하지 말고 하던 일을 잘 마무리 짓도록 하십시오. 사람을 잘 사귀면 그로 인해 큰 이익이 있겠습니다.','부처넉끼 지성껏 불공을 드리면 어려운 꼴을 면할 수 있습니다. 다른 사람과 일을 도모하려면 먼저 그 사람의 굳은 마음을 헤아려야 합니다. 산새가 길을 잃고 둥지를 못찾아 허공에 떠있는 것이니 정직을 기해야만 옳은 방향을 가려할 것입니다.','2025-03-02 11:59:28.019773+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (421,'052','您怎么知道住在房子里的燕子和麻雀很疯狂，但是买房子的人群呢？一旦您快乐，曾经愉快，您该怎么做？每天都要注意很多干扰和黑色时光。','我的翅膀破了，所以很难回来。请小心，因为水和火很惊讶。在元旦和携带的那一天，它将是正确而明亮的，但这是正确的，因为它轻巧而丑陋，但不坐着。','如果您是前所未有的，但是您会被吸引认可并帮助他人，请小心。春天有很多心脏，所以这是一对或孩子。 Shinsu很难，所以不要奔跑或做新事物。这将导致痛苦。','将为这一天提供帮助的官员是他在西方和北部的地方。完成工作或恢复是有利可图的。在三月和四月，最好提前祈祷。如果您在表亲之间有很多心脏，并且有Uhwan，那将很难给人留下深刻的印象。','如果您听甜蜜的话，很容易进入小型NOL。如果您提前吃掉它，您可能会生气并受到祝福。内心有贫穷的话，所以我总是不知所措。','如果您看一下，请仔细。然后，即使您不再得到它，也会收到诚意的价格。在东方，官员会偶然来，因此，如果您开始新工作或谨慎工作，您将有利可图。即使您没有获得大财富，也会有很小的利润。','这是双方都协调并最终实现条形的时候。如果您将自己的力量与他人结合在一起，则可以实现乐队。 Shinsu是很长的路要走，我很幸运。我如何犹豫与人见面？祝你好运会像我一样有帮助。','在七月和八月，恢复工作很幸运。如果不是结果，后代将倾向于。这是多么富裕，因为野鸡卖出，月亮在花朵上喝醉了，身体在花朵上喝醉了。','要小心，因为似乎很渴望与他人一起玩，但变成了丑陋。由于喷泉是最好的，因此有毒政党将没有任何好处来推广大事物。这个月的运气必须小心和诚实。','请注意，您的名字和管理层有一个头，但这就像尾巴。如果您符合另一种利益，它肯定会跟随太阳。官员在哪里穿越困难？它是西方和北。您必须诚实地完成工作和推广新事物。','我想这样做，但我不能走，所以我只会积聚心。如果您靠近，您肯定会成为结果。利润在西方和北部，因此我们必须完成工作。','即使发生财富，但另一个人可能会嫉妒和伤害。东方是不利的，西方很长，所以不要开始工作，也不要获得新的休息。如果您使人们变得良好，那么您将获得巨大的利润。','如果您处于智能状态，则可以避免佛陀。为了促进与他人的工作，您必须首先计算人的坚定心脏。山禽迷路了，他们找不到巢，因此他们必须诚实地朝着正确的方向前进。','2025-03-02 11:59:28.019773+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (492,'052','家に住んでいるツバメやスズメが狂っていることをどうやって知っていますか？あなたが幸せで、一度快適になったら、あなたはこれをどのようにしますか？毎日多くの妨害と黒い時間に注意してください。','私は壊れた鳥の翼を持っているので、戻るのは非常に難しいです。水と火に驚かされるものがあるので注意してください。元旦と持ち運びには、それは正しくて明るくなりますが、それは明るくて醜いが座っていないので正しいでしょう。','あなたが前例のないが、あなたが認識に惹かれ、他の人を助けるならば、注意してください。春には多くの心があるので、カップルまたは子供です。ぐらつきは難しいので、走ったり、新しいことをしたりしないでください。それは苦悩につながります。','その日を助ける役人は、彼が西と北にいる場所です。作業を終了したり回復したりする利益があります。 3月と4月には、事前に祈るのは良いことです。あなたがあなたのいとこの間に多くの心を持っていて、あなたがウーワンを持っているなら、それは感動するのが難しいでしょう。','甘い言葉を聞くと、小さなNOLに移動するのは簡単です。事前に食べると、怒って祝福されます。心の中で言うべき貧弱さがあるので、私はいつも私の心の外にいます。','あなたがそれを見るならば、慎重に取得してください。それから、たとえあなたがそれを二度と手に入れなくても、あなたは誠実さの価格を受け取るでしょう。東部では、役人は偶然に来るので、新しい仕事を始めたり、仕事の器用さに注意したりすると、あなたは利益を上げるでしょう。あなたが大きな富を得ていなくても、あなたは小さな利益を得るでしょう。','両側が調和し、バーが最終的に満たされるときです。自分の強さを他の人と組み合わせると、バンドを達成できます。忍は長い道のりであり、私は自分自身に幸運です。どうすれば人々と会うことをheすることができますか？私と同じように幸運が役立ちます。','7月と8月には、仕事の回復は非常に恵まれています。結果でない場合、子孫は傾斜します。キジが売って月が花を酔っている朝、体は花に酔っているので、それはどれほど金持ちですか。','他の人と遊ぶのは長いと思われるので注意してください。しかし、それはugいに変わります。噴水は最高なので、大きなものを促進するために有毒な政党に利益はありません。今月の運は注意し、正直でなければなりません。','あなたの名前と管理に頭がありますが、それは尾のようなものであることに注意してください。あなたが別の興味を持っているなら、それはきっと太陽に従うでしょう。困難を乗り越えるのは誰ですか？西と北です。仕事を終えて新しいことを宣伝することについて正直でなければなりません。','やりたいのですが、行けないので、心だけを蓄積します。近づくと、きっと結果になります。利益は西と北にあるので、作業を終了する必要があります。','富は起こりますが、他の人はjeして害を及ぼすかもしれません。東は不利であり、西は長いので、新しい休憩を取得するために働き始めないでください。あなたが人々をうまく作るなら、あなたは大きな利益を得るでしょう。','あなたが知性にあるならば、仏は避けることができます。他の人との仕事を促進するには、まず人のしっかりした心を数えなければなりません。山の鳥は失われ、彼らは巣を見つけることができないので、彼らは正しい方向に行くために正直でなければなりません。','2025-03-02 11:59:28.019773+00','j');
